	public static boolean validataCode(String code) {
		if (StringUtils.isBlank(code))
			return false;
		String str = "40,42,89";
		if (StringUtils.isBlank(str))
			return true;
		String[] sp = str.split(",");
		for (String string : sp) {
			if (code.startsWith(string))
				return false;
		}
		return true;
	}

